import React, { Component } from 'react';


const Buttons = props => {

    return(
        <div>
            <button text="True" onClick={props.pointCounter}>TRUE</button>
            <button text="False" onClick={props.pointCounter}>FALSE</button>
            <button onClick={props.changeScore}>testmeout</button>
        </div>
    )
}

export default Buttons;
